const e = createEngine(gameCanvas, 300, 300);

for (let i = 0; i < 11; i++) {
  const t = 0.5 - i/10;
  e.add({
    x: e.width/2 + t * 180,
    y: e.height/2 + t * 180,
    scale: 2,
    origin: [0.5, 0.5],
    sprite: cart,
    /* look at what happens when you remove this line! */
    zIndex: 10 - i,
    update(me) {
      const dx = me.x - e.mouseX,
            dy = me.y - e.mouseY;
      const dist = Math.sqrt(dx*dx + dy*dy);
      me.scale = 2.5 - Math.max(0, Math.min(1, dist / 100));

      /* how can you make the cartridges under your mouse render OVER
         the ones farther away from your mouse? */
    }
  })
}

e.start();
